import Layout from '../components/myLayout';
import Link from 'next/link';

export default function Blog() {
    return (
        <Layout>
            <h1>Batman TV Shows</h1>
                <ul>
                {props.shows.map(show => (
                    <li key={show.id}>
                    <Link href="/p/[id]" as={`/p/${show.id}`}>
                        <a>{show.name}</a>
                    </Link>
                    </li>
                ))}
                </ul>
        </Layout>
    )
}
